import React from 'react'
import Quadrado from './Quadrado'

export default ()=>{

    return (

        <div>

            <Quadrado w = '100px' h = '100px' cor = 'red' />
            <Quadrado w = '100px' h = '100px' cor = 'blue' />
            <Quadrado w = '100px' h = '100px' cor = 'yellow' />
            <Quadrado w = '100px' h = '100px' cor = 'brown' />
        </div>
    )
}
